        internal void IntToVInt(int _Value)
        {
            List<byte> _Writer = new List<byte>();
            _Writer.AddVInt(_Value);
            Console.WriteLine("Int To VInt : " + _Value + " = " + BitConverter.ToString(_Writer.ToArray()));
            _Writer = null;
        }

        internal void Uncompress(string Hexa)
        {
            string[] filePaths = Directory.GetFiles(@"Dumps/Dumps", "End_Client_Turn (14102*.bin");
            foreach (string t in filePaths)
            {
                //File.Delete(t);
                Console.WriteLine($"Reading File: {t}");
                Reader br = new Reader(File.ReadAllBytes(t));
                this.SubTick = br.ReadInt32();
                this.Checksum = br.ReadInt32();
                this.CommandCount = br.ReadInt32();
                if (this.CommandCount <= 512)
                {
                    if (this.CommandCount > 0)
                    {
                        this.Commands = new List<Command>(this.CommandCount);

                        bool Fine = true;
                        for (int i = 0; i < this.CommandCount; i++)
                        {
                            var CommandID = br.ReadInt32();

                            if (Factory.Commands.ContainsKey(CommandID))
                            {
                                var Command = Factory.CreateCommand(CommandID, null, br);

                                if (Command != null)
                                {
                                    Logging.Info(this.GetType(), "Command is handled! (" + CommandID + ")");
                                    Command.Decode();
                                }
                                else
                                {
                                    Logging.Info(this.GetType(), "Command is null! (" + CommandID + ")");
                                    this.CommandCount = this.Commands.Count;
                                    break;
                                }
                            }
                            else
                            {
                                Fine = false;
                                this.CommandCount = this.Commands.Count;
                                br.BaseStream.Position -= 4;
                                Logging.Info(this.GetType(), "Command is unhandled! (" + CommandID + ")");
                                break;
                            }
                        }
                        if (Fine)
                            continue;
                    }
                }
                else
                    Logging.Error(this.GetType(), "Command count is too high! (" + this.CommandCount + ")");

                var data = br.ReadFully();
                Console.WriteLine(BitConverter.ToString(data).Replace("-", ""));
                Console.WriteLine(Encoding.UTF8.GetString(data));
                break;
            }
        }
